#region using directives

using Chirping.Web.Api.Common.Storage;

using Microsoft.VisualStudio.TestTools.UnitTesting;

using System;
using System.Collections.Generic;
using System.IO;
using System.Text;
using System.Text.RegularExpressions;

#endregion

namespace Chirping.Web.Api.Tests.Storage
{
    /// <summary>
    /// Summary description for ProfileImageTest
    /// </summary>
    [TestClass]
    public class ProfileImageTest
    {
        [TestMethod]
        public void Can_Generate_File_Name()
        {
            // arrange
            string originalImage = GetOriginalImage();
            var filename = Guid.NewGuid().ToString("N");
            
            // act
            var images = ProfileImageInitializer.GenerateImages(originalImage, filename);

            // assert
            Assert.AreEqual<int>(2, images.Count);

            AssertImage1(images[0], @"\w{32}.jpg", new System.Drawing.Size(800, 800)); // original
            AssertImage1(images[1], @"\w{32}_avatar.jpg", new System.Drawing.Size(75, 75)); // avatar
        }

        private static void AssertImage1(Image originalImage, string pattern, System.Drawing.Size imageSize)
        {
            Assert.IsTrue(Regex.Match(originalImage.FileName, pattern).Success);

            var file = originalImage.ImageInBytes;
            using (var stream = new MemoryStream(file))
            {
                using (var bitmap = new System.Drawing.Bitmap(stream))
                {
                    Assert.AreEqual<int>(bitmap.Width, imageSize.Width);
                    Assert.AreEqual<int>(bitmap.Height, imageSize.Height);
                }
            }
        }

        private string GetOriginalImage()
        {
            return @"";
        }
    }
}
